var numberOfBeams = function (bank) {
  let count = 0;

  bank = bank.filter((ls) => Number(ls) != 0);
  for (let i = 0; i < bank.length; i++) {
    let mainElementOnesCount = bank[i].split("1").length - 1;
    let secondElementOnesCount = 0;
    if (i + 1 < bank.length) {
      secondElementOnesCount = bank[i + 1].split("1").length - 1;
    }
    count = count + mainElementOnesCount * secondElementOnesCount;
  }

  return count;
};

